import axios from 'axios';

class ProxyService {
  static test(endPoint, username, password, timeout = 2000) {
    const data = JSON.stringify({
      endPoint, timeout
    });

    const config = {
      method: 'post',
      url: process.env.REACT_APP_PROXY_TEST_URL,
      headers: {
        'Authorization': `Basic ${window.btoa(username + ":" + password)}`,
        'Content-Type': 'application/json'
      },
      data
    };

    return axios(config);
  }

  static send(endPoint, username, password, fileName, fileContent, timeout = 2000) {
    const data = JSON.stringify({
      endPoint, timeout, fileName, fileContent
    });

    const config = {
      method: 'post',
      url: process.env.REACT_APP_PROXY_URL,
      headers: {
        'Authorization': `Basic ${window.btoa(username + ":" + password)}`,
        'Content-Type': 'application/json'
      },
      data
    };

    return axios(config);
  }
}


export default ProxyService;
